<!DOCTYPE html>
<html lang="it">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>GiR Reception Report Generator</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            padding: 20px;
            min-height: 100vh;
        }

        .container {
            max-width: 1400px;
            margin: 0 auto;
            display: grid;
            grid-template-columns: 400px 1fr;
            gap: 30px;
        }

        .form-panel {
            background: white;
            padding: 25px;
            border-radius: 12px;
            box-shadow: 0 10px 30px rgba(0,0,0,0.2);
            overflow-y: auto;
            max-height: 90vh;
        }

        .form-title {
            font-size: 20px;
            font-weight: bold;
            color: #d4af37;
            margin-bottom: 20px;
            border-bottom: 3px solid #d4af37;
            padding-bottom: 10px;
            text-transform: uppercase;
            letter-spacing: 1px;
        }

        .form-group {
            margin-bottom: 12px;
        }

        .form-group label {
            display: block;
            font-weight: 600;
            font-size: 12px;
            margin-bottom: 4px;
            color: #333;
            text-transform: uppercase;
        }

        .form-group input,
        .form-group select,
        .form-group textarea {
            width: 100%;
            padding: 8px 12px;
            border: 2px solid #e0e0e0;
            border-radius: 6px;
            font-size: 13px;
            transition: all 0.3s;
        }

        .form-group input:focus,
        .form-group select:focus,
        .form-group textarea:focus {
            outline: none;
            border-color: #d4af37;
            box-shadow: 0 0 0 3px rgba(212, 175, 55, 0.1);
        }

        .two-col {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 10px;
        }

        .three-col {
            display: grid;
            grid-template-columns: 1fr 1fr 1fr;
            gap: 10px;
        }

        .buttons {
            display: flex;
            gap: 10px;
            margin-top: 20px;
        }

        button {
            flex: 1;
            padding: 12px;
            border: none;
            border-radius: 6px;
            font-weight: bold;
            cursor: pointer;
            font-size: 13px;
            text-transform: uppercase;
            letter-spacing: 0.5px;
            transition: all 0.3s;
        }

        .btn-pdf {
            background: linear-gradient(135deg, #d4af37 0%, #c5a028 100%);
            color: white;
            box-shadow: 0 4px 6px rgba(212, 175, 55, 0.3);
        }

        .btn-pdf:hover {
            transform: translateY(-2px);
            box-shadow: 0 6px 12px rgba(212, 175, 55, 0.4);
        }

        .btn-reset {
            background: #f0f0f0;
            border: 2px solid #ddd;
            color: #666;
        }

        .btn-reset:hover {
            background: #e0e0e0;
        }

        .preview-panel {
            position: sticky;
            top: 20px;
            height: fit-content;
        }

        .preview-label {
            font-size: 16px;
            font-weight: bold;
            color: white;
            margin-bottom: 15px;
            text-shadow: 0 2px 4px rgba(0,0,0,0.2);
        }

        #previewCanvas {
            border: 3px solid white;
            border-radius: 8px;
            box-shadow: 0 10px 30px rgba(0,0,0,0.3);
            max-width: 100%;
            height: auto;
            display: block;
            background: white;
        }

        .sinpo-grid {
            display: grid;
            grid-template-columns: repeat(5, 1fr);
            gap: 5px;
            margin-top: 10px;
            padding: 15px;
            background: #f8f9fa;
            border-radius: 8px;
            border: 2px solid #e0e0e0;
        }

        .sinpo-title {
            font-weight: bold;
            color: #333;
            margin-bottom: 8px;
            font-size: 14px;
            text-align: center;
            letter-spacing: 3px;
        }

        .status-message {
            margin-top: 10px;
            padding: 10px;
            border-radius: 6px;
            font-size: 12px;
            display: none;
        }

        .status-success {
            background: #d4edda;
            color: #155724;
            border: 1px solid #c3e6cb;
            display: block;
        }

        @media (max-width: 1200px) {
            .container {
                grid-template-columns: 1fr;
            }
            .preview-panel {
                position: static;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <!-- FORM PANEL -->
        <div class="form-panel">
            <div class="form-title">üìã Dati Reception Report</div>

            <form id="receptionForm">
                <!-- Sezione Dati Utente -->
                <div style="background: #fff8e1; padding: 15px; border-radius: 8px; margin-bottom: 15px; border-left: 4px solid #d4af37;">
                    <div style="font-weight: bold; color: #d4af37; margin-bottom: 10px; font-size: 12px; text-transform: uppercase;">Dati Ricevente</div>
                    <div class="two-col">
                        <div class="form-group">
                            <label>Call:</label>
                            <input type="text" name="call" placeholder="I7/BA-63829" value="I7/BA-63829" style="text-align: center;">
                        </div>
                        <div class="form-group">
                            <label>Name:</label>
                            <input type="text" name="name" placeholder="Alfredo Gallerati" value="Alfredo Gallerati" style="text-align: center;">
                        </div>
                    </div>
                    <div class="two-col">
                        <div class="form-group">
                            <label>RX (Ricevitore):</label>
                            <input type="text" name="rx" placeholder="ETON-1; Yaesu FRG 100" value="ETON-1; Yaesu FRG 100" style="text-align: center;">
                        </div>
                        <div class="form-group">
                            <label>ANT (Antenna):</label>
                            <input type="text" name="antenna" placeholder="Dipole" value="Dipole" style="text-align: center;">
                        </div>
                    </div>
                </div>

                <!-- Sezione Stazione -->
                <div style="background: #ffebee; padding: 15px; border-radius: 8px; margin-bottom: 15px; border-left: 4px solid #cc0000;">
                    <div style="font-weight: bold; color: #cc0000; margin-bottom: 10px; font-size: 12px; text-transform: uppercase;">Dati Stazione</div>
                    <div class="form-group">
                        <label>To Radio Station:</label>
                        <input type="text" name="station" placeholder="Radio Caroline" value="Radio Caroline" style="color: #cc0000; font-weight: bold;">
                    </div>
                    <div class="form-group">
                        <label>Altri dati di ricezione:</label>
                        <input type="text" name="station_address" placeholder="Solar Flare A index K Index Wheater Condition (WX)" value="Solar Flare A index K Index Wheater Condition (WX)">
                    </div>
                </div>

                <!-- Sezione Ricezione -->
                <div style="background: #e3f2fd; padding: 15px; border-radius: 8px; margin-bottom: 15px; border-left: 4px solid #2196f3;">
                    <div style="font-weight: bold; color: #2196f3; margin-bottom: 10px; font-size: 12px; text-transform: uppercase;">Dettagli Ricezione</div>
                    <div class="three-col">
                        <div class="form-group">
                            <label>Date:</label>
                            <input type="date" name="date" value="2025-11-15">
                        </div>
                        <div class="form-group">
                            <label>UTC Start:</label>
                            <input type="text" name="utc_start" value="12:25" placeholder="12:25">
                        </div>
                        <div class="form-group">
                            <label>UTC End:</label>
                            <input type="text" name="utc_end" value="12:57" placeholder="12:57">
                        </div>
                    </div>
                    <div class="three-col">
                        <div class="form-group">
                            <label>Frequency (kHz):</label>
                            <input type="number" name="frequency" placeholder="648" value="648">
                        </div>
                        <div class="form-group">
                            <label>Mode:</label>
                            <select name="mode">
                                <option value="">--</option>
                                <option value="AM" selected>AM</option>
                                <option value="FM">FM</option>
                                <option value="SSB">SSB</option>
                                <option value="CW">CW</option>
                                <option value="DRM">DRM</option>
                            </select>
                        </div>
                    </div>
                </div>

                <!-- Sezione SINPO -->
                <div class="sinpo-title">S I N P O</div>
                <div class="sinpo-grid">
                    <div class="form-group" style="text-align: center;">
                        <label style="font-size: 18px; color: #d4af37; font-weight: bold;">S</label>
                        <input type="number" name="sinpo_s" min="1" max="5" placeholder="5" value="5" style="text-align: center; font-size: 18px; font-weight: bold;">
                    </div>
                    <div class="form-group" style="text-align: center;">
                        <label style="font-size: 18px; color: #d4af37; font-weight: bold;">I</label>
                        <input type="number" name="sinpo_i" min="1" max="5" placeholder="4" value="4" style="text-align: center; font-size: 18px; font-weight: bold;">
                    </div>
                    <div class="form-group" style="text-align: center;">
                        <label style="font-size: 18px; color: #d4af37; font-weight: bold;">N</label>
                        <input type="number" name="sinpo_n" min="1" max="5" placeholder="3" value="3" style="text-align: center; font-size: 18px; font-weight: bold;">
                    </div>
                    <div class="form-group" style="text-align: center;">
                        <label style="font-size: 18px; color: #d4af37; font-weight: bold;">P</label>
                        <input type="number" name="sinpo_p" min="1" max="5" placeholder="4" value="4" style="text-align: center; font-size: 18px; font-weight: bold;">
                    </div>
                    <div class="form-group" style="text-align: center;">
                        <label style="font-size: 18px; color: #d4af37; font-weight: bold;">O</label>
                        <input type="number" name="sinpo_o" min="1" max="5" placeholder="4" value="4" style="text-align: center; font-size: 18px; font-weight: bold;">
                    </div>
                </div>
                <div class="buttons">
                    <button type="button" class="btn-pdf" onclick="generaImmagine()">üñºÔ∏è Genera Anteprima</button>
                    <button type="button" class="btn-pdf" onclick="scaricaImmagine()" style="background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);">üíæ Scarica PNG</button>
                    <button type="reset" class="btn-reset">üîÑ Reset</button>
                </div>
            </form>
        </div>

        <!-- PREVIEW PANEL -->
        <div class="preview-panel">
            <div class="preview-label">üëÅÔ∏è Anteprima Reception Report</div>
            <canvas id="previewCanvas"></canvas>
            <div style="margin-top: 15px; padding: 15px; background: rgba(255,255,255,0.9); border-radius: 8px; font-size: 12px; color: #666;">
                <strong>Istruzioni:</strong><br>
                1. Compila i campi del form<br>
                2. Clicca "Genera Anteprima"<br>
                3. Scarica il risultato finale
            </div>
        </div>
    </div>

                o: { x: 59.8, y: 85, color: '#000000', font: 'bold 48px Arial', align: 'center' }
            },
            // Sezione basso destra - Reception Details: righe pi√π vicine
            details: {
                date: { x: 82, y: 77, color: '#000000', font: 'bold 18px Arial', align: 'left' },
                utcStart: { x: 82, y: 81, color: '#000000', font: 'bold 18px Arial', align: 'left' },
                utcEnd: { x: 89, y: 81, color: '#000000', font: 'bold 18px Arial', align: 'left' },
                freq: { x: 82, y: 85, color: '#000000', font: 'bold 18px Arial', align: 'left' },
                mode: { x: 82, y: 89, color: '#000000', font: 'bold 18px Arial', align: 'left' }
          }
        };

        function drawText(text, layoutItem) {
            if (!text) return;

            const x = (layoutItem.x / 100) * canvas.width;
            const y = (layoutItem.y / 100) * canvas.height;

            ctx.font = layoutItem.font;
            ctx.fillStyle = layoutItem.color;
            ctx.textAlign = layoutItem.align || 'left';
            ctx.textBaseline = 'middle';

            ctx.fillText(text, x, y);
        }

        function generaImmagine() {
            if (!templateImage) {
                alert('Attenzione: Template non caricato. Verifica il base64.');
                return;
            }

            // Pulisci e ridisegna lo sfondo
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            ctx.drawImage(templateImage, 0, 0);

            // Recupera dati dal form
            const form = document.getElementById('receptionForm');
            const formData = {
                call: form.querySelector('[name="call"]').value,
                name: form.querySelector('[name="name"]').value,
                rx: form.querySelector('[name="rx"]').value,
                antenna: form.querySelector('[name="antenna"]').value,
                station: form.querySelector('[name="station"]').value,
                stationAddress: form.querySelector('[name="station_address"]').value,
                date: form.querySelector('[name="date"]').value,
                utcStart: form.querySelector('[name="utc_start"]').value,
                utcEnd: form.querySelector('[name="utc_end"]').value,
                frequency: form.querySelector('[name="frequency"]').value,
                mode: form.querySelector('[name="mode"]').value,
                sinpo: {
                    s: form.querySelector('[name="sinpo_s"]').value,
                    i: form.querySelector('[name="sinpo_i"]').value,
                    n: form.querySelector('[name="sinpo_n"]').value,
                    p: form.querySelector('[name="sinpo_p"]').value,
                    o: form.querySelector('[name="sinpo_o"]').value
                }
            };

            // Formatta data se presente
            let dateFormatted = formData.date;
            if (dateFormatted) {
                const d = new Date(dateFormatted);
                dateFormatted = d.toLocaleDateString('en-GB', { day: 'numeric', month: 'long', year: 'numeric' });
            }

            // Disegna sezione Header (alto destra) - righe pi√π vicine
            drawText(formData.call, layout.header.call);
            drawText(formData.name, layout.header.name);
            drawText(formData.rx, layout.header.rx);
            drawText(formData.antenna, layout.header.ant);

            // Disegna sezione Stazione (basso sinistra)
            drawText(formData.station, layout.station.name);
            drawText(formData.stationAddress, layout.station.address);

            // Disegna SINPO (centro)
            drawText(formData.sinpo.s, layout.sinpo.s);
            drawText(formData.sinpo.i, layout.sinpo.i);
            drawText(formData.sinpo.n, layout.sinpo.n);
            drawText(formData.sinpo.p, layout.sinpo.p);
            drawText(formData.sinpo.o, layout.sinpo.o);

            // Disegna Reception Details (basso destra) - righe pi√π vicine
            drawText(dateFormatted, layout.details.date);
            drawText(formData.utcStart, layout.details.utcStart);
            drawText(formData.utcEnd, layout.details.utcEnd);
            drawText(formData.frequency, layout.details.freq);
            drawText(formData.mode, layout.details.mode);
        }

        function scaricaImmagine() {
            if (!templateImage) {
                alert('Genera prima l\'anteprima');
                return;
            }
            generaImmagine();
            const link = document.createElement('a');
            link.download = 'RA-GIR_Reception_Report_' + new Date().toISOString().slice(0,10) + '.png';
            link.href = canvas.toDataURL('image/png');
            link.click();
        }

        document.getElementById('receptionForm').addEventListener('input', function() {
            if (templateImage) {
                clearTimeout(window.updateTimer);
                window.updateTimer = setTimeout(generaImmagine, 300);
            }
        });
    </script>
</body>
</html>
